import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';

const PageOne = () => {
    return <div>Page 1</div>
}

const PageTwo = () => {
    return <div>Page 2</div>
}

const App = () => {
    return (
        <div>
            <BrowserRouter>
            <div>
                <Route path='/' component={PageOne}/>
                <Route path='/pageTwo' component={PageTwo}/>
            </div>
            </BrowserRouter>
        </div>
    );
};

export default App;
